--GAN ROLE

BEGIN
  -- BAN GIAM DOC : 1->5
  FOR i IN 1..5 LOOP
    EXECUTE IMMEDIATE 'GRANT Ban_giam_doc TO NV'||LPAD(i, 3, '0');
  END LOOP;
  -- TRUONG DE AN: 6->8
  FOR i IN 6..8 LOOP
    EXECUTE IMMEDIATE 'GRANT Truong_De_An TO NV'||LPAD(i, 3, '0');
  END LOOP;
  -- NHAN SU: 9->13  
   FOR i IN 9..13 LOOP
    EXECUTE IMMEDIATE 'GRANT Nhan_Su TO NV'||LPAD(i, 3, '0');
  END LOOP;
  -- TAI CHINH: 14->18
   FOR i IN 14..18 LOOP
    EXECUTE IMMEDIATE 'GRANT Tai_Chinh TO NV'||LPAD(i, 3, '0');
  END LOOP;
  -- TRUONG PHONG: 19->26
   FOR i IN 19..26 LOOP
    EXECUTE IMMEDIATE 'GRANT Truong_Phong TO NV'||LPAD(i, 3, '0');
  END LOOP;
  -- QL TRUC TIEP: 27->46
   FOR i IN 27..46 LOOP
    EXECUTE IMMEDIATE 'GRANT QL_Truc_Tiep TO NV'||LPAD(i, 3, '0');
  END LOOP;
  -- NHAN VIEN: 47 -> 346
   FOR i IN 47..346 LOOP
    EXECUTE IMMEDIATE 'GRANT Nhan_Vien TO NV'||LPAD(i, 3, '0');
  END LOOP;
END;

