-- Nhan vien duoc xem thong tin cua chinh minh 
CREATE VIEW NHANVIEN_V
AS
SELECT MANV, TENNV, PHAI, NGAYSINH, DIACHI, SODT, LUONG, PHUCAP, VAITRO, MANQL, PHG FROM NHANVIEN WHERE MANV = SYS_CONTEXT('USERENV', 'SESSION_USER');
GRANT SELECT ON NHANVIEN_V TO Nhan_Vien;
-- Nhan vien duoc xem thong tin PHANCONG cua chinh minh
CREATE VIEW PHANCONG_V
AS
SELECT MANV, MADA, THOIGIAN FROM PHANCONG WHERE MANV = SYS_CONTEXT('USERENV', 'SESSION_USER');
GRANT SELECT ON PHANCONG_V TO Nhan_Vien;
-- Nhan vien chi duoc cap nhat lai thong tin ngaysinh, diachi, sodt cua chinh minh ma thoi
CREATE VIEW NHANVIENUPDATE_V
AS
SELECT NGAYSINH, DIACHI, SODT FROM NHANVIEN WHERE MANV = SYS_CONTEXT('USERENV', 'SESSION_USER');
GRANT UPDATE ON NHANVIENUPDATE_V TO Nhan_Vien;
--Nhan Vien duoc xem thong tin toan bo tren PHONGBAN 
GRANT SELECT ON PHONGBAN TO Nhan_Vien;
--Nhan Vien duoc xem thong tin toan bo tren DEAN
GRANT SELECT ON DEAN TO Nhan_Vien;



