--Quan ly truc tiep co quyen nhu mot nhan vien thong thuong
GRANT Nhan_Vien TO QL_Truc_Tiep;


CREATE VIEW NHANVIENQUANLY_V AS
SELECT MANV, TENNV, PHAI, NGAYSINH, DIACHI, SODT, VAITRO
FROM NHANVIEN;

--Cac nhan vien quan ly truc tiep co the xem cac thong tin nhan vien minh quan l
CREATE OR REPLACE FUNCTION sec_function_3 (
   schema_name VARCHAR2,
   object_name VARCHAR2
)
   RETURN VARCHAR2
AS
   predicate VARCHAR2 (200);
   ur VARCHAR2(100);
BEGIN
   ur := SYS_CONTEXT('USERENV', 'SESSION_USER');
   predicate := 'MANV IN (SELECT MANV FROM NHANVIENQUANLY WHERE MANVQL = ''' || ur || ''')';
   RETURN predicate;
END;
BEGIN
  DBMS_RLS.ADD_POLICY (
    object_schema   => 'QUANLY',
    object_name     => 'NHANVIENQUANLY_V',
    policy_name     => 'policy_7',
    policy_function => 'sec_function_3',
    statement_types => 'SELECT'
  );
END;
GRANT SELECT ON NHANVIENQUANLY_V TO QL_Truc_Tiep;
--Cac nhan vien quan ly truc tiep co the xem cac thong tin PHANCONG cua nhan vien minh quan l
