BEGIN
  DBMS_RLS.ADD_POLICY (
    object_schema   => 'QUANLY',
    object_name     => 'NHANVIENQLPHANCONG_V',
    policy_name     => 'policy_8',
    policy_function => 'sec_function_3',
    statement_types => 'SELECT'
  );
END;

GRANT SELECT ON NHANVIENQLPHANCONG_V TO QL_Truc_Tiep;


