-- Bang cac nhan vien thuoc phong ban nao 
CREATE TABLE NHANVIENPHONGBAN(
  MAPB VARCHAR2(5),
  TENPB VARCHAR2(20),
  MANV VARCHAR2(5),
  TENNV VARCHAR2(30),
  MANVTPB VARCHAR2(5),
  TENNVTPB VARCHAR2(30),
  PRIMARY KEY(MAPB, MANV, MANVTPB)
);


CREATE VIEW NHANVIENPHONGBAN_V AS
SELECT MANV, TENNV, PHAI, NGAYSINH, DIACHI, SODT, VAITRO
FROM NHANVIEN;

--Cac nhan vien truong phong ban co the xem cac thong tin nhan vien minh phong ban cua minh
CREATE OR REPLACE FUNCTION sec_function_4 (
   schema_name VARCHAR2,
   object_name VARCHAR2
)
   RETURN VARCHAR2
AS
   predicate VARCHAR2 (200);
   ur VARCHAR2(100);
BEGIN
   ur := SYS_CONTEXT('USERENV', 'SESSION_USER');
   predicate := 'MANV IN (SELECT MANV FROM NHANVIENPHONGBAN WHERE MANVTPB = ''' || ur || ''')';
   RETURN predicate;
END;
BEGIN
  DBMS_RLS.ADD_POLICY (
    object_schema   => 'QUANLY',
    object_name     => 'NHANVIENPHONGBAN_V',
    policy_name     => 'policy_9',
    policy_function => 'sec_function_4',
    statement_types => 'SELECT'
  );
END;
GRANT SELECT ON NHANVIENPHONGBAN_V TO Truong_Phong;
--Cac nhan vien truong phong ban co the xem chinh sua cac thong tin nhan vien tren bang PHANCONG thuoc phong ban minh
CREATE VIEW NHANVIENPBPHANCONG_V AS
SELECT MANV, MADA, THOIGIAN
FROM PHANCONG WHERE MANV IN (SELECT MANV FROM NHANVIENPHONGBAN WHERE MANVTPB = SYS_CONTEXT('USERENV', 'SESSION_USER'));

GRANT SELECT, UPDATE, DELETE, INSERT ON NHANVIENPBPHANCONG_V TO Truong_Phong;

