--Nhan vien tai chinh co quyen nhu mot nhan vien thong thuong
GRANT Nhan_Vien TO Tai_Chinh;

--Nhan vien tai chinh dc select tren tat ca cac thuoc tinh cua nhanvien va phancong
CREATE OR REPLACE VIEW TC_NHANVIEN
AS
SELECT NV.MANV, NV.TENNV, NV.PHAI, NV.NGAYSINH, NV.DIACHI, NV.SODT
FROM NHANVIEN NV;

CREATE OR REPLACE VIEW TC_PHANCONG
AS
SELECT NV.MANV, PC.MADA, PC.THOIGIAN
FROM NHANVIEN NV JOIN PHANCONG PC ON NV.MANV = PC.MANV;

GRANT SELECT ON TC_NHANVIEN TO Tai_Chinh;
GRANT SELECT ON TC_PHANCONG TO Tai_Chinh;

